pragma solidity ^0.5.0;

contract Hosting {
    address public owner;
    uint public numberOfTickets;
    uint public ticketPrice;
    mapping(uint => address) public ticketOwners;

    event EventHosted(uint numberOfTickets, uint ticketPrice);
    event TicketSold(uint ticketNumber, address buyer);

    constructor() public {
        owner = msg.sender;
    }

    function hostEvent(uint _numberOfTickets, uint _ticketPrice) public {
        require(msg.sender == owner, "Only organizer can host event");
        numberOfTickets = _numberOfTickets;
        ticketPrice = _ticketPrice;
        emit EventHosted(_numberOfTickets, _ticketPrice);
    }

    function sellTicket(uint ticketNumber, uint num) public payable {
        require(msg.value == ticketPrice, "Incorrect payment amount");
        require(ticketOwners[ticketNumber] == address(0), "Ticket already sold");
        ticketOwners[ticketNumber] = msg.sender;
        emit TicketSold(ticketNumber, msg.sender);
    }
}
